import React, { Component, Fragment } from 'react';
import Row from 'reactstrap/lib/Row';
import { Col } from 'reactstrap';
import Sidebar from './Sidebar';
import Content from './Content';

class TwoColumnLayout extends Component {
    render() {
        return (
            <Fragment>
                <Row>>
                 <Header />
                </Row>
                <Row>
                    <Col sm="4">
                        <Sidebar />
                    </Col>
                    <Col sm="4">
                        <h1>Content</h1>
                    </Col>
                </Row>
            </Fragment>
        )
    }
}
